Marca: AtlasCopco;
Tiempo de trabajo continuo principal: 24 horas/día;
Potencia nominal: 5kW;
Potencia máxima: 5,5 kW;
Número de fases: monofásica;
Capacidad del depósito de combustible: 25 l;
Nivel de presión sonora (LPA) a 7m: 72dB(A)
La marca AtlasCopco es líder mundial en la producción de equipos industriales y generadores. Si está buscando maquinaria que pueda soportar un funcionamiento intensivo y tenga soporte de servicio, AtlasCopco es una opción bien conocida. Abordaje amigable y profesional de sus necesidades, brindándole confianza en autonomía y calidad.
Generador monofásico de gasolina P6500 Atlas Copco Diseñado para un uso diario intensivo. El generador está enrollado en cobre y ofrece un rendimiento excelente combinado con facilidad de uso y transporte gracias a las ruedas. El mango y las ruedas pueden ser montados por cualquier usuario. La unidad le permite tener electricidad donde sea necesaria y cumple con los estándares de ruido de la UE. El generador tiene un depósito de combustible ampliado con una capacidad de 25 litros. Equipado con una placa AVR que proporciona regulación automática del voltaje de salida, haciéndolo siempre perfectamente constante bajo diferentes condiciones de carga. El motor arranca mediante un arranque eléctrico con llave. Tiene un interruptor diferencial y un relé de control de subtensión en su arsenal. Se instala protección contra el funcionamiento con bajo nivel de aceite. El nivel de presión acústica (LPA) a una distancia de 7 m es de sólo 72 dB(A). A modo de comparación: los generadores chinos de pequeña potencia (p. ej., 3 kW) producen un nivel de ruido de al menos 92 dB, ¡un 25% más ruidoso que uno sueco! Lo que garantiza un funcionamiento cómodo tanto del generador como de las personas que lo rodean. Hay dos tipos de enchufes, un indicador de combustible, un cuentahoras y un voltímetro. - depósito de combustible ampliado - sensor de nivel de aceite - protección contra sobrecalentamiento - cumple con las normas de ruido de la UE (carcasa de aislamiento acústico) - enchufes - sistema de regulación automática de voltaje (AVR) - indicadores: bajo nivel de aceite del motor, sobrecarga del motor - conectores y cables para funcionamiento en paralelo
